import React from 'react';

const Contact = () => (
  <section className="section">
    <h2>Contact Us</h2>
    <p>Email: join@crossfitbeastmode.com</p>
    <p>Location: 123 Gym St, Fitville</p>
  </section>
);

export default Contact;
